import React, {StrictMode} from 'react';
import Router from './Router';
import {RecoilRoot} from 'recoil';
import {createRoot} from 'react-dom/client';

createRoot(
	<StrictMode>
		<RecoilRoot>
			<Router />
		</RecoilRoot>
	</StrictMode>,
	document.getElementById('root'),
);
